import {BrowserRouter, Routes, Route} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <h1>SuperMarket</h1>
<BrowserRouter>
<Route  path='/' element={<ListaUsuarios/>}></Route>
<Route  path='/AgregarUsuario' element={<AgregarUsuario/>}></Route>
<Route  path='/EditarUsuario' element={<EditarUsuario/>}></Route>

</BrowserRouter>

      <ListaUsuarios/>
      <AgregarUsuario/>
      <EditarUsuario/>    
    </div>
  );
}

export default App;
